import React from 'react';
import './App.css'
const Cardcss={backgroundColor:"#D7D9CE",
        width:"max-content"
  }
const btnCss={color:"#B3001B",
  fontSize:"18px",
  fontWeight:"800",
  padding:'3px',
  marginLeft:'10%',
  borderRadius:'30px',
  outline:'none'
}
function Cards(){
  return(
    <>
      <div className="Card" style={Cardcss}>
        <img src="https://images-na.ssl-images-amazon.com/images/M/MV5BMjEzMDAxOTUyMV5BMl5BanBnXkFtZTgwNzAxMzYzOTE@._V1_.jpg"
          width="200px" height="200px"
        />
        <div className="CardInfo" >
          <div className="title" style={{color:"#262626",fontFamily:"monospace"}}><h2>Stranger Things</h2></div>
          <button style={btnCss}>Watch NOW</button>
        </div>
      </div>
    </>
  )
}
export default Cards;
